import React from 'react';


function Header() {
  return (
    <div>
      <form>
        <input type="text" placeholder="Search" />
        <i class="ri-search-line"></i>
        <select style={{border:"none", width:"100px"}}>
        <option>Relevance</option>
        <option>Home</option>
        <option>Explore</option>
        </select>
      </form>
     
    </div>
  );
}

export default Header;
